import React from "react";
import PropTypes from "prop-types";
import { Card, CardBody, CardTitle, Table } from "reactstrap";
import { Link } from "react-router-dom";
import { map } from "lodash";

const FileAttatchment = ({ files }) => {
  return (
    <Card>
      <CardBody>
        <CardTitle className='mb-4 text-gray'>Attached Files</CardTitle>
        <div className='table-responsive'>
          <Table className='table table-nowrap table-centered table-hover mb-0'>
            <tbody>
              {map(files, (file, i) => (
                <tr key={"_file_" + i}>
                  <td style={{ width: "45px" }}>
                    <div className='avatar-sm'>
                      <span className='avatar-title rounded-circle bg-soft bg-primary text-primary font-size-24'>
                        <i className='bx bxs-file-doc' />
                      </span>
                    </div>
                  </td>
                  <td>
                    <h5 className='font-size-14 mb-1'>
                      <Link to='#' className='text-dark'>
                        {file.name}
                      </Link>
                    </h5>
                    <small>Size : {file.size}</small>
                  </td>
                  <td>
                    <div className='text-center'>
                      <Link to={file.link} className='text-dark'>
                        <i className='bx bx-download h3 m-0' />
                      </Link>
                    </div>
                  </td>
                </tr>
              ))}
            </tbody>
          </Table>
        </div>
      </CardBody>
    </Card>
  );
};

FileAttatchment.propTypes = {
  files: PropTypes.array,
};

export default FileAttatchment;
